htm += "<td class='menu2' style='min-width:50px;width:50px;'>行動順</td>";
htm += "<td class='menu2' style='min-width:150px;width:150px;'>Skill</td>";
htm += "<td class='menu2' style='min-width:50px;width:50px;'>BP</td>";
