htm += "<td class='menu4' style='min-width:3000px;width:3000px;'>　戦闘ログ</td>";
htm += "</tr>";
for (j = 0; j < resultData[pageId][charId].length; j++) {
if (j % 7 == 6) { htm += "<td class='menu3'>　" + resultData[pageId][charId][j] + "</td></tr>" }
else { htm += "<td class='menu'>" + resultData[pageId][charId][j] + "</td>" }
}
